swaptrade_modal_desc_crosschain_valuedif:
Comisioanele integrate în diferența de valoare pentru această tranzacție bridge sunt:
• Comision bridge cross-chain: {bridgePriceAndFee}
• Comision de rețea pe rețeaua de destinație: {toChainPriceAndFee}

• Când tranzacționați o anumită sumă de tokenuri, este afectată mărimea fondului de lichiditate. Acest lucru, la rândul său, modifică disponibilitatea totală și prețul tokenurilor, ducând la schimbări semnificative de preț.

swaptrade_servicefee_tab_desc_fees_are_c:
Comisioanele sunt încasate în funcție de tipurile de tokenuri dintr-o pereche de tokenuri. Într-o tranzacție swap de tip token A – token B, OKX stabilește rata comisionului prin verificarea tipurilor de tokenuri în următoarea ordine:

1. Majoritatea criptomonedelor stabile;
2. Majoritatea tokenurilor native/încapsulate;
3. Dacă nu există tokenuri din primele 2 categorii în perechea de tokenuri, OKX va încasa comisionul prin utilizarea tokenului cu lichiditate mai mare la momentul tranzacției.
4. Comisioanele și tokenurile tarifate se vor reflecta în istoricul de tranzacționare al utilizatorilor.

