swaptrade_mid_dialog_desc_est_network_fe:
În tranzacțiile bridge, acest comision include comisioanele de rețea atât pentru rețeaua sursă, cât și pentru bridge cross-chain.

Comisionul acestei tranzacții este compus din:
· comision de rețea {chain}: {value1}
