Nu percepem comisioane de rețea deoarece acestea sunt plăți către mineri.

swaptrade_intro_dialog_desc_cross_value_:
Diferența de valoare pentru această tranzacție este afișată astfel:
· {chain} comision de rețea: {value1}
· {bridge} comision bridge: {value2}

Dacă diferența de valoare este mult mai mare în timp ce comisioanele listate mai sus sunt relativ mici, acest lucru apare deoarece suma pentru bridge a afectat mărimea fondului de lichiditate pentru această pereche de tokenuri.

swaptrade_intro_tooltip_trade_including_:
În tranzacțiile bridge, costul include comisionul de rețea pentru rețeaua de plată și o parte din comisionul bridge cross-chain. Detalierea comisionului pentru această tranzacție:
• Comision de rețea: {fromChainPriceAndFee}
• Comision bridge cross-chain: {bridgePriceAndFee}
Comisionul de rețea acoperă costurile minerilor și nu este perceput de platforma noastră.

